var Car = /** @class */ (function () {
    function Car(company, model, year, color, price, imgSrc) {
        try {
            if (!company || !model || isNaN(year) || !color || isNaN(price) || !imgSrc)
                throw new Error("Input Error");
            this.company = company;
            this.model = model;
            this.year = year;
            this.color = color;
            this.price = price;
            this.imgSrc = imgSrc;
        }
        catch (error) {
            console.error(error);
            return;
        }
    }
    return Car;
}());
;
var cars = [
    new Car("Toyota", "Corola", 2017, "Black", 85000, "data:image/jpeg;base64,"),
    new Car("Subaru", "Impreza", 2020, "White", 65000, "data:image/jpeg;base64,"),
    new Car("Mazda", "2", 2018, "Blue", 63000, "data:image/jpeg;base64,"),
    new Car("Renult", "Clio", 2022, "White", 95000, "data:image/jpeg;base64,"),
    new Car("Audi", "TT", 2017, "Black", 105000, "data:image/jpeg;base64,"),
    new Car("Kia", "Sportage", 2020, "Gray", 85000, "data:image/jpeg;base64,")
];
var root = document.querySelector("#root");
var carsHTML = cars
    .map(function (car) {
    return "<div><img src =" + car.imgSrc + "><p>Company:" + car.company + ", Model:" + car.model + ", Year:" + car.year + ", Color:" + car.color + ", Price:" + car.price + "</p></div>";
})
    .join(" ");
console.log(carsHTML);
if (root) {
    root.innerHTML = carsHTML;
}
